'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs he started into his speech, I realized that the words he spoke would not be as powerful as the image of him, an African American, standing on these stages. This was the gift and the struggle of working for Obama.\n\nSeptember 22, 2018\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cObama was unique in that the mere fact of his own identity was going to leave an imprint on people abroad. In addition to being the American president, he was a symbol for the aspirations of billions of people—particularly ethnic minorities in the developed world and young people in the developing world. It’s why we carved out time for him to engage populations who wouldn’t normally meet an American president—playing soccer in a favela in Brazil, meeting Dalits in India, or visiting a refugee center in Malaysia. It’s why we established programs for him to engage young people, particularly in the two regions most associated with his background, Africa and Southeast Asia. And it’s one reason why he focused so much on the words that he spoke abroad. “We’re telling a story,” he told me early that first year, “about who we are.”\n\nSeptember 23, 2018\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Why don’t I just give this to you—you can fill in the others.” With that, he proceeded to pace slowly around the Oval Office for nearly an hour, pausing every so often over the pad on his desk, dictating his outline. Within it he had embedded a series of policy decisions and how he wanted them framed—about how to categorize detainees at Gitmo, about how to balance transparency and secrecy in government. When he was finished, he told me to scrub it with the rest of the staff and get him a draft in a few days. And so I had the awkward responsibility—as, essentially, a midlevel staffer—of calling a meeting the following day with the senior White House staff so that I could tell them what the president wanted to do. As I was working on this speech, it became clear to me how agencies form their own antibodies against a president’s desire to move in a particular direction.\n\nSeptember 22, 2018\n\u001c66\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs one Muslim colleague said to me, the phrase “radical Islam” is heard by many Muslims as a characterization of Islam itself and not of a faction within it. Meanwhile, the polling that had been done showed that what most Muslims actually cared about was poverty, corruption, and unemployment. If you asked them what they wanted to work with America on, the answers were education and entrepreneurship, science and technology. If you asked them what U.S. policy was focused on, they said oil, Israel, and weakening the Muslim world.\n\nSeptember 22, 2018\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYears later, after Obama left office, I ran into a Palestinian-born woman whom I knew casually. She said she’d never forgotten the Cairo speech, which she connected to the initial protests of the Arab Spring. I said that that was assigning too much responsibility to a speech. “It wasn’t the speech,” she said. “It was him. The young people saw him, a black man as president of America, someone who looked like them. And they thought, why not me?”\n\nSeptember 23, 2018\n\u001c78\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs would often be the case, he vented about things that he could not really change, the structural dynamic in Washington that sees politics as a game and foreign policy as an extension of politics.\n\nSeptember 23, 2018\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe sat next to me on the couch and began to talk, not so much about the speech, but about the kind of president he wanted to be. “The American people are idealists,” he said, “but their leaders have to be realistic and hard-headed.” At the beginning and end of the speech, he wanted to draw upon American idealism—Roosevelt’s belief that we “carry special burdens” in the world. In between, he wanted to acknowledge that in disorderly places there is a limit to what we can achieve.\n\nSeptember 23, 2018\n\u001c97\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1zUa9lv3SPciQlLXhjB2g7vffNKe35Fc1wJg_Zxk","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1ssWqAAcJgm5eVK0Rzu7qCTJ7wGoRYAnL2A3Ax1g","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1VRrBUgLpRHo8L5aTzhuBOQ13oiWRjyAcUTrFyDA","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline"