s_va_i":false,"ts_fs":13.0,"ts_ff":"Verdana","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3651,"ei":3670,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3671,"ei":3688,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3689,"ei":4172,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Verdana","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4173,"ei":4192,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4193,"ei":4198,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime('', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="aMTGfe4209z949sTAIJ+XOng1bU">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="aMTGfe4209z949sTAIJ+XOng1bU">DOCS_modelChunk = [{"ty":"is","ibi":4199,"s":"\n\n\nPart Two: Spring\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnother time, at a meeting on what he was aiming to accomplish in his first term, I pointed to the potential for a democratic opening in Burma. “Ben,” he said, “no one cares about Burma in Ohio.” These comments stuck with me. For the first time, I felt out of step with my boss. In the quiet of my empty apartment, I began to wrestle with bigger questions. How would I see myself in five years if I couldn’t remember what I was like five years ago? How do you establish your own voice when your entire reputation is founded on someone else’s? How much can you compromise your own positions in service of a larger good before you sacrifice them? I felt we had gradually trimmed our sails and lowered our sights\n\nSeptember 24, 2018\n\u001c196\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI looked, increasingly, for smaller things that I could work on—if I had outlets on issues where I could make a difference, it could add a layer to my experience at work separate from the grind of politics and the intractability of some of the larger issues on our agenda.\n\nSeptember 24, 2018\n\u001c197\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cObama would practice an answer, and then we’d critique his performance. “Get into it faster.” “Look at the person who asked the question.” “Don’t forget your home base.” At some point, Obama, who liked to name the absurdities of politics, snapped. “I get it,” he said. “So this isn’t really a debate at all, it’s just a performance.” He asked that we just write up the best answers he could give on key questions, drawing on the best answers he gave in debate prep.\n\nSeptember 25, 2018\n\u001c210\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAfterward, as the flight to Cambodia gained altitude, Obama came to see me. “That was worth doing,” he said. He looked out the window. “It’s interesting how the place feels frozen in time. It reminds me of what Jakarta looked like when I lived there. Now it’s just high-rises. They’d be smart to preserve some of what makes this part of the world different.”\n\nSeptember 24, 2018\n\u001c215\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI also argued that if we were going to intervene in Syria’s civil war, we should do so with our own military. From Central America to Afghanistan, America didn’t have a great track record with arming proxies. If we thought it was worth tipping the balance against Assad, we should be debating whether to strike his regime directly. I pressed this point in a few meetings in late 2012 and early 2013, but I was usually the only person doing so other than Jake and Samantha. In one meeting early in the second term, Obama went around the room as he normally did when he wanted to test the status quo of his policies. Jake and I were sitting together on the back bench, and when it got to us, we made versions of the same argument. If things keep deteriorating, I said, we should “consider bombing Assad’s runways” or we should “consider limited strikes against some regime infrastructure.”\n\nSeptember 24, 2018\n\u001c219\n\u0011\n\u0011\n\n\nPart Three: Change\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSOUTHEAST ASIA BECAME THE other region I took on, as it pulled together the different threads of what interested me the most in our foreign policy: the burden of history, and the wars in Vietnam, Cambodia, and Laos; the strategic importance of a region that was increasingly important to our position vis-à-vis China; an essential part of any effort to combat climate change; a sprawling place populated by people of different religions and ethnicities. A place of opportunity.\n\nSeptember 25, 2018\n\u001c238\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“We know that, like South Africa, the United States had to overcome centuries of racial subjugation. As was true here, it took sacrifice—the sacrifice of countless people, known and unknown, to see the dawn of a new day. Michelle and I are beneficiaries of that struggle….Over 30 years ago, while still a student, I learned of Nelson Mandela and the struggles taking place in this beautiful land, and it stirred something in me. It woke me up to my responsibilities to others and to myself, and it set me on an improbable journey that finds me here today. And while I will always fall short of Madiba’s example, he makes me want to be a better man.”\n\nSeptember 27, 2018\n\u001c283\n\u0011\n\u0011"},{"ty":"te","id":"i.10","spi":5290},{"ty":"te","id":"i.11","spi":5796},{"ty":"te","id":"i.12","spi":6195},{"ty":"te","id":"i.13","spi":7144},{"ty":"te","id":"i.14","spi":7662},{"ty":"te","id":"i.8","spi":4227},{"ty":"te","id":"i.9","spi":4977},{"ty":"as","st":"paragraph","si":4199,"ei":4199,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4200,"ei":4200,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4201,"ei":4201,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_sa":11.25,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true,"ps_sb_i":true,"ps_sa_i":false,"ps_kwn_i":true,"ps_ifl_i":true}},{"ty":"as","st":"paragraph","si":4218,"ei":4218,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_sa":11.25,"ps_il_i":true,"ps_sb":11.25,"ps_ir_i":true,"ps_al_i":true,"ps_sb_i":true,"ps_sa_i":true,"ps_hd":2,"ps_kwn_i":true,"ps_ifl_i":true}},{"ty":"as","st":"paragraph","si":4219,"ei":4219,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4220,"ei":4220,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4222,"ei":4222,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4224,"ei":4224,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54